import { Component, OnInit } from '@angular/core';
import { LoanService } from '../loan.service';

@Component({
  selector: 'app-loan',
  templateUrl: './loan.component.html',
  styleUrls: ['./loan.component.css']
})
export class LoanComponent implements OnInit {
  loans: any;
  loanAmount:any;
  loanInterestRate:any;
  loanTenure:any;
  accountId: number = 17; // Example account ID, replace with actual

    // Define the displayed columns for the table
  displayedColumns: string[] = ['id', 'loanAmount','accountHolderName','accountNumber', 'status'];


  constructor(private loanService: LoanService) {}

  ngOnInit(): void {
    this.loadLoans();
  }

  loadLoans() {
    this.loanService.getLoansForAccount(this.accountId).subscribe((data) => {
      this.loans = [data];
      console.log(data); // Inspect the structure here // Wrap data in an array if it's a single object
    });
  }

  applyForLoan(amount: number, interestRate: number, tenure: number) {
    this.loanService.applyForLoan(this.accountId, amount, interestRate, tenure).subscribe(
      (response) => {
        console.log("Loan application successful", response);
        this.loadLoans(); // Reload loans after applying to show the updated list
        alert("apply successfull")
      },
      (error) => {
        console.error("Error applying for loan", error);
        alert("error")
      }
    );
  }


  approveLoan(loanId: number) {
    this.loanService.approveLoan(loanId).subscribe(() => {
      this.loadLoans(); // Reload loans after approval
    });
  }
}
 <div>
  <h1>loans</h1>


 <!-- Loan Application Form -->
  <form (ngSubmit)="applyForLoan(loanAmount, loanInterestRate, loanTenure)">
    <div>
      <label for="loanAmount">AccountId:</label>
      <input id="loanAmount" type="number" [(ngModel)]="accountId" name="loanAmount" required>
    </div>

    <div>
      <label for="loanAmount">Loan Amount:</label>
      <input id="loanAmount" type="number" [(ngModel)]="loanAmount" name="loanAmount" required>
    </div>

    <div>
      <label for="loanInterestRate">Interest Rate (%):</label>
      <input id="loanInterestRate" type="number" [(ngModel)]="loanInterestRate" name="loanInterestRate" required>
    </div>

    <div>
      <label for="loanTenure">Tenure (Months):</label>
      <input id="loanTenure" type="number" [(ngModel)]="loanTenure" name="loanTenure" required>
    </div>

    <button mat-raised-button type="submit">Apply for Loan</button>
  </form>





<!-- Loans Table -->
<table mat-table [dataSource]="loans">
  <ng-container matColumnDef="id">
    <th mat-header-cell *matHeaderCellDef> Loan ID </th>
    <td mat-cell *matCellDef="let loan"> {{ loan.loan.id }} </td>
  </ng-container>

  <ng-container matColumnDef="loanAmount">
    <th mat-header-cell *matHeaderCellDef> Loan Amount </th>
    <td mat-cell *matCellDef="let loan"> {{ loan.loan.loanAmount }} </td>
  </ng-container>

  <ng-container matColumnDef="accountHolderName">
    <th mat-header-cell *matHeaderCellDef> Account Holder Name </th>
    <td mat-cell *matCellDef="let loan"> {{ loan.accountHolderName }} </td>
  </ng-container>

  <ng-container matColumnDef="accountNumber">
    <th mat-header-cell *matHeaderCellDef> Account Number </th>
    <td mat-cell *matCellDef="let loan"> {{ loan.accountNumber }} </td>
  </ng-container>

  <ng-container matColumnDef="status">
    <th mat-header-cell *matHeaderCellDef> Status </th>
    <td mat-cell *matCellDef="let loan"> {{ loan.loan.status }} </td>
  </ng-container>

  <tr mat-header-row *matHeaderRowDef="displayedColumns"></tr>
  <tr mat-row *matRowDef="let row; columns: displayedColumns;"></tr>
</table>
</div>
